ips&nbsp;to verify that you have started an GetCashBackHere Shopping Trip, but we usually can\'t confirm Cash Back earned at the time of purchase, because it takes time for the store to notify us that you made a purchase. Depending on the store, this can take from a few hours to several days.</p>\n<p>Once the store lets us know that you\'ve made a purchase, we will add Cash Back to your account and send you an email confirmation. At that point, your&nbsp;Cash Back Balance&nbsp;will be viewable.</p>',183,165,'enable','2018-02-28 14:00:55','2018-02-28 20:45:11',117,NULL),(605,'how-to-earn-cash-back','How to Earn Cash Back','','','','','<p>At GetCashBackHere, we don&rsquo;t ask you to fill out forms or earn points. In fact, earning Cash Back with us is as easy as 1-2-3:</p>\n<ol class=\"mar-20-l mar-10-b\">\n<li><span class=\"prox-b\">Shop:</span>&nbsp;First, start an GetCashBackHere Shopping Trip. To do this, simply be sure to click on any GetCashBackHere link to the store you&rsquo;ll shop with before you make a purchase.</li>\n<li><span class=\"prox-b\">Validate:</span>&nbsp;When you click an GetCashBackHere link, you&rsquo;ll see a pop-up confirmation letting you know you&rsquo;re ready to shop and earn Cash Back at that store.</li>\n<li><span class=\"prox-b\">Purchase:</span>&nbsp;Complete your purchase as you normally would. This will also complete your Shopping Trip.</li>\n</ol>\n<p>That&rsquo;s all you have to do.</p>\n<p>Once the store lets us know that you&rsquo;ve made a purchase, we add your Cash Back to your account and send you an email confirmation. It usually takes a little time for the store to let us know that your purchase was completed. Depending on the store, this can take from a few hours to several days. Then, every three months, we send you the Cash Back you&rsquo;ve earned, in a Big Fat Check or via PayPal.</p>\n<p><strong><span class=\"prox-b f-16 f-gry-dk lh-22\">Retroactively earning Cash Back</span></strong></p>\n<p>Did you place an order, but forgot to go through GetCashBackHere first? Unfortunately, you can only earn Cash Back by starting a Shopping Trip with GetCashBackHere first. We have no way to add Cash Back after a purchase has already been made.</p>\n<p>If you are finding it difficult to remember to go to GetCashBackHere.net before you purchase, try our Cash Back Button. It pops up automatically on any site where GetCashBackHere Cash Back is available, and it even finds coupons for you.</p>',183,183,'enable','2018-02-28 14:08:00','2018-02-28 14:09:47',117,NULL),(606,'https://docs.google.com/spreadsheets/d/15Ueo5Z5kZNtc3Do4tdFsNrJG6t1_5OIsJi_XnIKXcoo/edit#gid=0','Test 1','Slug','1','','23x123x213','<p>Slug</p>',165,165,'enable','2018-02-28 20:31:08','2018-02-28 20:32:09',103,NULL),(607,'https://translate.google.com/?hl=vi#en/vi/Slug','Test 2','oogle.com/?hl=vi#en/vi/Slug','test','','','<p><span style=\"font-size: 12pt; font-family: \'arial black\', sans-serif;\"><em>Slug&nbsp;<span data-sheets-value=\"{&quot;1&quot;:2,&quot;2&quot;:&quot;Create a new category\\n   Title\\n   Category\\n   Slug\\n   Status\\n   Description\\n   Meta description\\n   Meta title\\n   Meta keywords\\n   Content&quot;}\" data-sheets-userformat=\"{&quot;2&quot;:8403967,&quot;3&quot;:[null,0],&quot;4&quot;:[null,2,16777215],&quot;5&quot;:{&quot;1&quot;:[{&quot;1&quot;:2,&quot;2&quot;:0,&quot;5&quot;:[null,2,0]},{&quot;1&quot;:0,&quot;2&quot;:0,&quot;3&quot;:3},{&quot;1&quot;:1,&quot;2&quot;:0,&quot;4&quot;:1}]},&quot;6&quot;:{&quot;1&quot;:[{&quot;1&quot;:2,&quot;2&quot;:0,&quot;5&quot;:[null,2,0]},{&quot;1&quot;:0,&quot;2&quot;:0,&quot;3&quot;:3},{&quot;1&quot;:1,&quot;2&quot;:0,&quot;4&quot;:1}]},&quot;7&quot;:{&quot;1&quot;:[{&quot;1&quot;:2,&quot;2&quot;:0,&quot;5&quot;:[null,2,0]},{&quot;1&quot;:0,&quot;2&quot;:0,&quot;3&quot;:3},{&quot;1&quot;:1,&quot;2&quot;:0,&quot;4&quot;:1}]},&quot;8&quot;:{&quot;1&quot;:[{&quot;1&quot;:2,&quot;2&quot;:0,&quot;5&quot;:[null,2,0]},{&quot;1&quot;:0,&quot;2&quot;:0,&quot;3&quo