INSERT INTO `collection` VALUES (2,'Handbags','Your handbag can make or break your entire look. Every intricate stitch is carefully assembled for that perfect blend of style and function. So it’s no surprise that you want the best your money can buy. With price-slashing promo codes and Cash Back at Ebates, that money can buy even more handbags. It’s a dream come true!\n\nWomen’s purses come in everything from cute clutches to expansive totes, designed to carry everything you need to get through the day and even transition to a night out on the town. But whether you’re living in the fast lane of a big city or confronting the hustle and bustle of busy parenthood, Ebates has the handbag deals you need for every look.\n\nIf designer handbags are your thing, we’ve got you covered. All of your favorite brands can be found at the best prices around. Get designers like Michael Kors and Kate Spade in the latest styles that scream chic without spending a small fortune. Shop the perfect satchels, crossbodies and hobos in all of the top handbag brands. Best of all, snag savings that can score you that adorable wristlet you’ve been eyeing without even spending any additional moolah.\n\nEbates helps you find the top coupons to save online or in-store on all of your favorite handbag styles. You’ll discover beautiful purses that are great for every day wear or for that special occasion. Flaunt your inner fashionista or get the purse that caters to your needs, all while earning Cash Back at Ebates. You’ll even find free shipping offers and the latest styles of the season that will make you swoon. A little retail therapy can go a long way. Reward yourself with the finer things in life – like that vintage inspired frame bag with the cute floral finishes. After all, when fashion meets function, it makes for the perfect accessory.\n\nThese deals are too good to pass up. Savor the savings found at Ebates and get a flawless handbag for the perfect price.',NULL,NULL,NULL,'show','show','handbags','active','2018-02-05 17:57:54','2018-02-06 13:28:48'),(5,'Luxury Collection','Treating yourself to a little high-end slice of heaven is a rewarding experience at Ebates. Shop the chicest brands and designers to elevate your look and lifestyle with free shipping offers and a promo code from your favorite luxury store to get the most for money while earning Cash Back at Ebates.\n\nTake styles from the catwalk to the sidewalk and save with designer clothing promo codes. Shop fabulous women’s clothing deals on dresses, separates, denim and outerwear from luxury designers. Look like you spent a fortune while secretly putting money back into your designer handbag.\n\nTop off your looks with a designer shoes promo code to save on pairs for every occasion. From sultry heels to stylish flats, you can find the perfect kicks for all of your outfits with women’s shoe sales. Have him looking dapper in discount designer shoes for men. Discover everything from dress shoes to boat shoes to high-end athletic shoes at unbeatable prices.\n\nShine bright with luxury accessories for her and him. With designer watches promo codes, you can find that amazing time piece you’ve been eyeing at prices you can easily afford. Get fantastic savings on necklaces, earrings, rings, bracelets and more with fine jewelry sales, promo codes and Cash Back at Ebates.\n\nFind the perfect looks for your little ones at the best value with a kids’ clothing promo code. From girls’ dresses to boys’ denim to kids’ shoes, you can get all your small sartorial needs and outfit your mini fashionistas at incredible deals.\n\nLive luxuriously from head to toe without breaking the bank thanks to Ebates luxury brands and designers.',NULL,NULL,NULL,'show','show','luxury','active','2018-02-06 17:39:37','2018-02-06 17:39:37');
